const VideoDetail = (props) => {
    if(!props.video){
        return< div>Loading...</div>;
    }
    console.log(props.video);
    return (
    <div className = "media">
        <h4>{props.video.snippet.title}</h4>
        <p>{props.video.snippet.description}</p>
    </div>
        );
}

export default VideoDetail;
